ეს არის ერთ-ერთი ყველაზე მშვენიერი გრძნობა, როცა შეგიძლია თბილი და სასიამოვნო ემოციები აჩუქო უახლოეს ადამიანებს. და ის ადამიანია, რომელიც ყოველთვის მოგისმენს, მხარს დაგიჭერს და სწორ გზაზე გაგიძღვება🌞 ახლა, ბავშვობაში  ჩემს დასთან გატარებულ წუთებს ვიხსენებდი, გამახსენდა, როგორ ხშირად ვუკეთებდით ერთმანეთს სასიამოვნო სიურპრიზებს საკუთარი ხელით.ახლა ჩვენ ვერ ვახერხებთ ერთმანეთის ნახვას ისე ხშირად, როგორც ჩვენ გვსურს და ამიტომ, თითოეულ ჩვენს შეხვედრაზე ვცდილობ მივცე მას რაღაც ძალიან გულწრფელი, რაც, რა თქმა უნდა, თბილ ემოციებს მისცემს მას. ამჯერად გადავწყვიტე მეჩუქებინა  მისთვის ჩვენი ბავშვობის მოგონება , უჩვეულო ფორმატში, მილკას შოკოლადთან ერთად 💜 შოკოლადები და სასიამოვნო მოგონებები ბავშვობიდან ერთ ყუთში. რა შეიძლება იყოს ამაზე ტკბილი და კარგი ?)
